import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { NavbarcComponent } from './components/navbarc/navbarc.component';
import { BodyComponent } from './components/body/body.component';
import { RouterModule } from '@angular/router';
import { PagenotfComponent } from './components/pagenotf/pagenotf.component';
import { RegisterComponent } from './components/register/register.component';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { AboutusComponent } from './component/aboutus/aboutus.component';
import { Aboutus1Component } from './components/aboutus1/aboutus1.component';
import { ReviewsComponent } from './components/reviews/reviews.component';



@NgModule({
  declarations: [
    AppComponent,
    NavbarcComponent,
    BodyComponent,
    PagenotfComponent,
    RegisterComponent,
    AboutusComponent,
    Aboutus1Component,
    ReviewsComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    RouterModule,
    HttpClientModule,
    FormsModule,
    ReactiveFormsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
